e conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n"]},{"data":{"text/html":["'fitbit'"],"text/latex":["'fitbit'"],"text/markdown":["'fitbit'"],"text/plain":["[1] \"fitbit\""]},"metadata":{},"output_type":"display_data"}],"source":["# This R environment comes with many helpful analytics packages installed\n","# It is defined by the kaggle/rstats Docker image: https://github.com/kaggle/docker-rstats\n","# For example, here's a helpful package to load\n","\n","library(tidyverse) # metapackage of all tidyverse packages\n","\n","# Input data files are available in the read-only \"../input/\" directory\n","# For example, running this (by clicking run or pressing Shift+Enter) will list all files under the input directory\n","\n","list.files(path = \"../input\")\n","\n","# You can write up to 20GB to the current directory (/kaggle/working/) that gets preserved as output when you create a version using \"Save & Run All\" \n","# You can also write temporary files to /kaggle/temp/, but they won't be saved outside of the current session"]},{"cell_type":"markdown","id":"161a6127","metadata":{"papermill":{"duration":0.010759,"end_time":"2025-07-25T18:22:15.374972","exception":false,"start_time":"2025-07-25T18:22:15.364213","status":"completed"},"tags":[]},"source":["**Bellabeat Fitbit dataset **\n","\n","About the dataset: This dataset generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring.\n","\n","\n","**## Scenario**\n","\n","You are a junior data analyst working on the marketing analyst team at Bellabeat, a high-tech manufacturer of health-focused\n","products for women. Bellabeat is a successful small company, but they have the potential to become a larger player in the\n","global smart device market. Urška Sršen, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart\n","device fitness data could help unlock new growth opportunities for the company. You have been asked to focus on one of\n","Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. The\n","insights you discover will then help guide marketing strategy for the company. You will present your analysis to the Bellabeat\n","executive team along with your high-level recommendations for Bellabeat’s marketing strategy.\n","\n","**## ASK**\n","\n","Sršen asks you to analyze smart device usage data in order to gain insight into how consumers use non-Bellabeat smart\n","devices. She then wants you to select one Bellabeat product to apply these insights to in your presentation. These questions\n","will guide your analysis:\n","1. What are some trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help influence Bellabeat marketing strategy?"]},{"cell_type":"markdown","id":"f8453df2","metadata":{"papermill":{"duration":0.015936,"end_time":"2025-07-25T18:22:15.402845","exception":false,"start_time":"2025-07-25T18:22:15.386909","status":"completed"},"tags":[]},"source":["**Prepare**\n","\n","Sršen encourages you to use public data that explores smart device users’ daily habits. She points you to a specific data set:\n","FitBit Fitness Tracker Data (CC0: Public Domain, dataset made available through Mobius): This Kaggle data set contains personal fitness tracker from thirty fitbit users. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, and heart rate that can be used to explore users’ habits.\n","\n","\n","**Process**"]},{"cell_type":"code","execution_count":2,"id":"